import Header from "../../components/Header";
import React, { useState } from 'react';
import { QrReader } from 'react-qr-reader';
import classes from "./Presensi.module.scss";
import Notification from "./Notification";

const PresensiPage = () => {
    const [data, setData] = useState('No result');
    const [dataMHS, setdataMHS] = useState({
        formData: "",
        nim: []
    })
    const [notification, setNotification] = useState({
        showNotification: false,
        msg: []
    })
    function handleClear(e) {
        e.preventDefault();
        setData('No result');
    }
    const handleSubmit = (event) => {
        console.log("submitted")
        event.preventDefault();
        console.log(dataMHS);
        setdataMHS({
            nim: [...dataMHS.nim, dataMHS.formData],
            formData: ""
        })
        // setdataMHS({
        //     formData: ""
        // })
    }
    const handleChange = (event) => {
        // event.preventDefault();
        setdataMHS({
            formData: event.target.value,
            nim: [...dataMHS.nim]
        })
        console.log(event.target.value)
        // setdataMHS({
        //     nim: [...dataMHS.nim, event.target.value]
        // })
    }

    // request to presensi rest API
    const presensi = async(event) => {
        event.preventDefault();
        console.log(notification.msg)
        setNotification({
            showNotification: false,
            msg: [...notification.msg]
        })
        await dataMHS.nim.map((npm, index) => {
            fetch('https://proxy-cors.carakan.id/http://202.91.9.14:6000/api/presensi_mobile/validate_qr_code', {
                method: 'POST',
                // mode: 'no-cors',
                referrerPolicy: 'no-referrer',
                headers: {
                    'User-Agent': '@m!k0mXv=#neMob!le',
                    'Content-Type': 'application/json' 
                },
                body: JSON.stringify({
                    data:`${data};${npm}`,
                    location: 'Amikom'
                })
            }).then(resp => {
                console.log(resp)
                setNotification({
                    showNotification: true,
                    msg: [...notification.msg, resp.status]
                })
                // new Promise((resolve) => {
                //     setTimeout(resolve, 5000)
                //     setNotification({
                //         showNotification: false
                //     })
                // })
                // console.log(notification)
            })

        })
        await console.log(`akhir ${notification.msg}`)
        await setTimeout(() => {
            setNotification({
                showNotification: false,
                msg: []
            });
        }, 5000);
    }


    return(
        <div className={classes.content}>
            <Header/>
            { notification.showNotification &&
                <div className={classes.content__notification}>
                    {notification.msg.map((message, index) => {
                        console.log(message)
                    })}
                    <Notification msg={notification.msg}/>
                </div>
            }
            {/* { notification.showNotification &&
                <div className={classes.content__notification}>
                    {
                        notification.msg.map((message, index) => {
                            <Notification key={index}  msg={message}/>
                        })
                    }

                </div>
            } */}
            <div>
                <QrReader
                    onResult={(result, error) => {
                    if (!!result) {
                        setData(result?.text);
                    }

                    if (!!error) {
                        console.info(error);
                    }
                    }}
                    style={{ width: '100%'}}
                    constraints={{
                        facingMode: 'environment'
                    }}
                />
            </div>
            <div className={classes.content__form}>
                <p>Qrcode Data :</p>
                <p className={classes.content__form__qrResult}>{data}</p>
                <button onClick={handleClear} className={classes.btnSubmit}>Clear QR Data</button>
                <div>
                    <p>Input your NIM : </p>    
                    <form onSubmit={handleSubmit}>
                        <input type="text" 
                            name="nim"
                            value={dataMHS.formData}
                            placeholder="nim"
                            onChange={handleChange}
                        />
                        <input type="submit" />
                    </form>
                </div>
                <table>
                    <thead>
                        <tr>
                            {/* <th>No</th> */}
                            <th>No</th>
                            <th>NIM</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {dataMHS.nim.map(( data, index) => 
                            <tr key={index}>
                                <td>{index+1}</td>
                                <td>{data}</td>
                                <td><p>delete</p></td>
                            </tr>
                        )}
                    </tbody>

                </table>
                <button onClick={presensi} className={classes.btnSubmit}>Presensi!</button>

            </div>

            {/* <ListNim nimData={dataMHS.nim}/> */}
        </div>
    )
}

export default PresensiPage
